import logo from "./logo.svg";
import "./App.css";

const random = Math.trunc(Math.random() * 6) + 1;
console.log(random);

const user = {
  name: "Hedy Lamarr",
  imageUrl: "https://i.imgur.com/yXOvdOSs.jpg",
  imageSize: 90,
};

const produce = [
  {
    name: "banana",
    isFruit: true,
    quant: 5,
  },
  {
    name: "tomato",
    isFruit: true,
    quant: 2,
  },
  {
    name: "carrot",
    isFruit: false,
    quant: 1,
  },
];

export default function App() {
  return (
    <>
      <h1>{user.name}</h1>
      <h2>{random > 3 ? "L" : "W"}</h2>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={"Photo of " + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize,
        }}
      />
    </>
  );
}
